                '\u003Ccenter\u003E\u003Cp\u003E        \u003Cb\u003E            FINDING INTERESTING IMAGES        \u003C/b\u003E\u003C/p\u003E\u003C/center\u003E\u003Cp\u003E    You are about to participate in an a psychological experiment to gather data about the INTERESTING\u002Dness of images.\u003C/p\u003E\u003Cp\u003E    However, first, you have to complete a practice run, which is what this is. This will ensure that you understand the directions and are able to work appropriately quickly and finish the task as desired. You will complete a practice experiment (\u003Cb\u003Eyou WILL be paid\u003C/b\u003E), which will determine if you are able to begin participating in the actual experiment.\u003C/p\u003E\u003Cp\u003E    Remember that in all segments, you must work as quickly as you can while still doing the task. Don\u0027t act randomly, but try not to think about things too much\u002D\u002Dthere are no \u0027wrong\u0027 answers, per se.\u003C/p\u003E\u003Cp\u003E    Click \u0027next\u0027 to go over an explanation of the task types.\u003C/p\u003E',

      "age":$('input[name=age]:checked').val(),
      "location":$('input[name=location]:checked').val()

var circle = new ProgressBar.Circle('#jspsych-target', {
color: '#FCB03C',
strokeWidth: 3,
trailWidth: 1,
duration: 1000,
text: {
    value: '0'
},
step: function(state, bar) {
    bar.setText((bar.value() * 100).toFixed(0));
}
});

function updateLoadedCount(nLoaded){
  var percentcomplete = nLoaded / images.length;
  circle.animate(percentcomplete);
}

jsPsych.preloadImages(images, function(){ startExperiment(); }, function(nLoaded) { updateLoadedCount(nLoaded); });


  function clearBox(elementID){
    document.getElementById(elementID).innerHTML = "";
  }

var experiment_structure = [

        start_block,

        keep_1_instr,

        keep_1,

        reject_1_instr,

        reject_1,

];

if (collect_demo) {
    experiment_structure.splice(0, 0, demo);
}

if (practice) {
    experiment_structure.push(debrief);
}

  function startExperiment(){
    //clearBox("jspsych-target");
    jsPsych.init({
      display_element: $('#jspsych-target'),
      experiment_structure: experiment_structure,
      on_finish: function() {
            if (practice){
                jsPsych.data.addProperties({
                    "is_practice":practice,
                    "passed_practice":passed_practice
                })
            } else {
                jsPsych.data.addProperties({
                    "is_practice":practice,
                    "passed_practice":true
                })
            }
            var turk_info = jsPsych.turk.turkInfo();
            jsPsych.data.addProperties({
                "assignmentId": turk_info.assignmentId,
                "hitId": turk_info.hitId,
                "workerId": turk_info.workerId,
                "previewMode": turk_info.previewMode,
                "outsideTurk": turk_info.outsideTurk,
                "taskId": task_id
            })
            jsPsych.data.displayData('csv');
      }
    });
  }
